import React, { useContext } from 'react';
import Typewriter from 'typewriter-effect';
import { ContextApi } from '../ContextApi';
import '../style/index';

function MainPage() {
  const { locale } = useContext(ContextApi);
  return (
    <div>
      <div className="container testContainer">
        <div className="row">
          <h1>{locale.hello}</h1>

          <h1>{locale.myName}</h1>
          <h1>{locale.iAm}</h1>
          <h1>
            <Typewriter
              options={{
                strings: [locale.FrontEndEngineer, locale.DivingLover],
                autoStart: true,
                loop: true,
              }}
            />
          </h1>
        </div>
      </div>
    </div>
  );
}
export default MainPage;
